 // Shadow value for this pixel < 0 - 1 >\n  if(shadowDist >= shadowMaxRadius) { shadowValue=0.; }\n  else {\n    float ssamp = texture2D(texture5, vLightPos.xy).r;\n    float blend = 1.-min(1., max(0., (shadowDist+shadowMaxRadiusBlend)-shadowMaxRadius)/shadowMaxRadiusBlend);\n    shadowValue = (1.-(vLightPos.z-ssamp>0.005?1.:0.))*blend;\n  }\n\n  /* Texture Samples */\n  vec3  texDiffuse = texture2D(texture0, vUV.st).rgb;\n  vec3  texNormal  = texture2D(texture1, vUV.st).rgb;\n  float texSpec    = texture2D(texture0, vUV.st).a;\n\n  /* Normal */\n  vec3 normal = rotate(vNormal, normalize(texNormal-vec3(.5))-vec3(0.,0.,1.)); // Rotate face normal by ((normal texture - center offset) - up)\n\n  /* Specular */\n  vec3 specDir  = normalize(vPos-(-eyeCenter));\n  vec3 specRef  = reflect(-aLightDirection, normal);\n  float specCenter = pow(max(0., dot(specDir, -eyeDirection)), 12.);\n  float specStr    = pow(max(0., dot(specRef, -eyeDirection)), 4.);\n  float specular = texSpec*specStr*specCenter;\n\n  /* Light & Shadow Values */\n  vec3 aLight = mix(aShadowColor, aLightColor, shadowValue*max(0., dot(normal, -aLightDirection)));\n  vec3 pLight = vec3(0.);\n\n  /* Dynamic Light */\n  for(int i=0;i<pMaxLights;i++) {\n    if(!(i<pLightLength)) { break; }\n\n    vec3 mag = (pLightPos[i]) - vPos;\n    float dist = sqrt((mag.x*mag.x) + (mag.y*mag.y) + (mag.z*mag.z));\n\n    if(dist < pLightRadius[i]) {\n      pLight += pLightColor[i]*(1.-(dist/pLightRadius[i]));\n    }\n  }\n\n  /* Finalize */\n  gl_FragColor = vec4(texDiffuse*((aLight+pLight)+(specular*specularity*aLightColor)), 1.);\n}\n",
